import React from 'react';
import { Link } from 'react-router-dom';

function AdminDashboard() {
  return (
    <div>
      <h2>Admin Dashboard</h2>
      <p>Manage employees, payroll, leaves, departments and jobs.</p>

  <div className="list-group">
  <Link className="list-group-item list-group-item-action" to="/admin/employees">Employee Management</Link>
  <Link className="list-group-item list-group-item-action" to="/admin/users">Users</Link>
  <Link className="list-group-item list-group-item-action" to="/admin/departments">Departments</Link>
  <Link className="list-group-item list-group-item-action" to="/admin/jobs">Jobs</Link>
            <Link className="list-group-item list-group-item-action" to="/admin/payroll">Payroll Processing</Link>
    <Link className="list-group-item list-group-item-action" to="#">Leave Management</Link>
  </div>
    </div>
  );
}

export default AdminDashboard;
